let initialState = {
    friendsData: [
        { id: 1, name: 'Anton', img: 'https://static.diary.ru/userdir/2/3/9/2/2392939/76858093.jpg' },
        { id: 2, name: 'Valia', img: 'https://i.pinimg.com/originals/c2/e4/01/c2e401c507b9f2a1322d7918f17cdf1e.jpg' },
        { id: 3, name: 'Sasha', img: 'https://i.pinimg.com/originals/e1/56/e0/e156e0e6aada7374c783aab65f280026.jpg' }
    ]
}

const sidebarReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state;
    }
}

export default sidebarReducer;
